I Have a Wife - Cosima
Added: November 3, 2014

Cosima finds her sister's husband Seth, sleeping in her bed. She gets a little curious about what he's packing under his briefs and decides to take a look. As she is doing this he wakes up and catches her in the act, she quickly deflects the conversation to finding out why he is sleeping where she should be. Seth got into a fight with his wife and now he is going have to fight his urge to fuck his wife's sister
